                        <div className='siderfirst'>
                            <span className='secondarytitle span'>目标转化事件：</span>
                            <Sider_first events={this.state.events} attrs={this.state.attrs} />
                        </div>
                        <div className='sidersecond'>
                            <p className='secondarytitle'>待归因事件：</p>
                            <Sider_second  events={this.state.events} attrs={this.state.attrs} />
                        </div>
                        <div className='siderthird'>
                            <p className='secondarytitle'>过程事件：</p>
                            <Sider_third  events={this.state.events} attrs={this.state.attrs} />
                        </div>
                    </form> */}
                </Sider>
                <Footer className='footer'>
                    Footer
                </Footer>
            </Layout>
        )
    }
}

ReactDom.render(<App />, document.getElementById('root'))
